import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="orange-background">
      <img src={logo} alt="logo" />
      <h2>ARK SERVER INI SETTING</h2>
    </div>
  );
}

export default App;
